function rdens = rdens_sucros(t)

%Inputfile with rootlength densities per  compartment and per day
%1: DATE
% 2:DAP
% 3:i
% 4:RDMLa (gram)
% 5:RLengthLa (cm)
% 6:RVolumeLa (cm³)
% 7:ERLa (cm)
% 8:RLDLa (cm cm-3)
% 9:RDLRCil (cm cm-3)

dosis = 999;

rootdata = zeros(101,101);
if dosis ==1
    data_in = importdata('RootDataDosis1.txt');
    data = data_in.data;
    for i=1:size(data,1)
    rootdata(data(i,3),data(i,2)) = data(i,5);
    end
    
elseif dosis == 2
    data_in = importdata('RootDataDosis2.txt');
    data = data_in.data;
    for i=1:size(data,1)
    rootdata(data(i,3),data(i,2)) = data(i,5);
    end
elseif dosis == 3
    data_in = importdata('RootDataDosis3.txt');
    data = data_in.data;
    for i=1:size(data,1)
    rootdata(data(i,3),data(i,2)) = data(i,5);
    end
elseif dosis == 4
    data_in = importdata('RootDataDosis4.txt');
    data = data_in.data;
    for i=1:size(data,1)
    rootdata(data(i,3),data(i,2)) = data(i,5);
    end
end

table = rootdata;


%table= table(:,2:end); %First column is not needed
time = 62:163; %Time
time = time';
index = max(find(t>= time(:,1)));
rdens = table(:,index)';

